import React from "react";
import coverPic from "../assets/coverPic.png";
const Vedas = () => {
  return (
    <div className="h-screen w-screen bg-[#69235B]">
      <div className="w-full h-[70%] relative">
        <img src={coverPic} alt="" className="w-full h-full" />
        <p className=" text-center z-1 absolute bottom-0 rounded-xl left-[40%] bg-[#CBCBFF] w-[15rem] px-10 py-3 text-[1rem] lg:text-[1.25rem] leading-[0.875rem] tracking-[0.00625rem] ">
          Arya, AI Acharya
        </p>
      </div>
    </div>
  );
};

export default Vedas;
